  \"Tumor prevalence in brown bullheads (Ameiurus nebulosus) from the South River,
  Anne Arundel County, Maryland\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:43:33.570297\",\n\t\"name\": \"tumor-prevalence-in-brown-bullheads-ameiurus-nebulosus-from-the-south-river-anne-arundel-c\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The South River is a tributary of the Chesapeake
  Bay flowing near Annapolis, Maryland. In March 2005, brown bullheads were collected
  in a fyke net set about 1.25 km downriver of the Route 50 Bridge. A total of 30
  brown bullheads (Ameiurus nebulosus) > 260 mm were randomly selected for analysis,
  placed in coolers and transported live to the U.S. Fish and Wildlife Chesapeake
  Bay Field Office. The fish were held in aerated site water and necropsied over the
  next two days. A gross examination was performed of the external organs, focusing
  on raised skin lesions and the appearance of the barbels. For all fish, livers were
  excised, weighed, cut into sections and preserved in 10% buffered neutral formalin.
  Sixteen fish had raised skin lesions, which were excised along with adjacent tissues,
  decalcified, and preserved similarly. Tissues were processed and histopathological
  examinations were performed. The objective was to determine the prevalence of liver
  and skin tumors and preneoplastic lesions. We reported a 20% (6 of 30) prevalence
  of liver tumors, split evenly between hepatocellular carcinomas and cholangiocarcinomas.
  All sixteen fish with the raised skin lesions were diagnosed with skin tumors (53%
  prevalence). Thirteen of these cases were invasive squamous carcinomas and three
  were non-invasive epidermal papillomas. Liver tumor prevalence was significantly
  (p=0.01, Fisheru2019s Exact Test) higher than that observed previously in collections
  from the Tuckahoe River (MD), considered a reference area (prevalence = 4% (5 of
  117)). The liver tumor prevalence in South River bullheads also exceeded the 5%
  criterion suggested as indicative of highly contaminated areas. Skin tumor prevalence
  was significantly different between locations (South River 16/30 = 53%, Tuckahoe:
  1/117 = 1%, p<0.001). The skin tumor prevalence in South River bullheads was about
  four times the 12% suggested criterion for highly contaminated areas. Barbel abnormalities
  were not significantly different (South: 3/30 = 10%, Tuckahoe: 3/87 = 3%, p=0.17).\",\n\t\"license_title\":
